* {
    box-sizing: border-box;
}

*::after,
*::before {
    box-sizing: border-box;
}

* {
    margin: 0;
    padding: 0;
}

a {
    color: inherit;
    text-decoration: none;
}

ul,
ol {
    list-style: none;
}

img {
    max-width: 100%;
    max-height: 100%;
}

body {

    background-color: #eee;
}

.globalHeader {
    display: flex;
    margin: 20px;
    justify-content: space-between;
}

.searchForm {
    display: flex;
    justify-content: space-between;
}

.searchForm>input {
    width: 100%;
    margin-right: 10px;
    height: 40px;
    padding: 0 10px;
    border: none;
    border: 1px solid #ddd;
    border-radius: 4px;
}

.searchForm>button {
    white-space: nowrap;
    padding: 0 25px;
    border: none;
    border-radius: 4px;
    background: #195EC5;
    color: white;
    font-size: 16px;
}

.globalMain {}

